import 'bootstrap/dist/css/bootstrap.min.css';

import React, {Component} from 'react'
import {
  Label, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem,
  NavLink, UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem, NavbarText
} from 'reactstrap';

class HomePage extends Component {
    constructor(props) {
        super(props)
    this.state = {
        currentUser: props.user
     }
    }

    toggle = () => {
        console.log("clicked")
    }
    render () {
        return (
            <div>
                <Navbar color="light" light expand="md">
                    <NavbarToggler onClick={this.toggle()} />
                    <NavbarBrand >Home</NavbarBrand>
                    <NavItem >Borrowable Tools                   </NavItem>
                    <NavbarText>{this.state.currentUser} Tool Management System</NavbarText>
                </Navbar>
            </div>
        )
    }

}
export default HomePage;
